import React from 'react'

const Posts = ({ posts, loading }) => {
    if(loading) {
        return <h2>LOADING...</h2>
    }

    return (
        // <ul className='list-group mb-4'>
        //     {posts.map(post => (
        //      <li key={post.id} className='list-group-item'>
        //          {post.title}
        //      </li>   
        //     ))}
        // </ul>
        <table className="table mt-2">
            <thead>
                <tr>
                <th>#</th>
                <th>Name</th>
                <th>Supplier</th>
                <th>Product</th>
                <th>Brand</th>
                <th>Batch Tracked</th>
                <th>Available</th>
                <th>Status</th>
                <th>Last Updated</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                <th scope="row">1</th>
                <td>Mark</td>
                <td>Otto</td>
                <td>@mdo</td>
                </tr>
                <tr>
                <th scope="row">2</th>
                <td>Jacob</td>
                <td>Thornton</td>
                <td>@fat</td>
                </tr>
                <tr>
                <th scope="row">3</th>
                <td>Larry</td>
                <td>the Bird</td>
                <td>@twitter</td>
                </tr>
            </tbody>
        </table>
    );
};

export default Posts;
